import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../styles/routineTemplates.css';  // variables, base styles
import '../styles/patientTemplates.css';  // page-specific styles

export default function PatientTemplates() {
  const [instances, setInstances] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [filterCategory, setFilterCategory] = useState('all');
  const [expanded, setExpanded] = useState({});

  // Decode JWT to extract patientId
  const getPatientId = () => {
    try {
      const token = localStorage.getItem('token');
      if (!token) return null;
      const payload = JSON.parse(atob(token.split('.')[1]));
      patientId = payload.user?.id || payload.id || payload.sub;
      return patientId;
    } catch {
      return null;
    }
  };

  useEffect(() => {
    const patientId = getPatientId();
    if (!patientId) {
      setError('Usuario no autenticado');
      setLoading(false);
      return;
    }
    const fetchData = async () => {
      try {
        const token = localStorage.getItem('token');
        const resp = await axios.get(`/api/routines/instances/${patientId}`, {
          headers: {'Content-Type': 'application/json', 'x-auth-token': token }
        });
        setInstances(resp.data);
      } catch (err) {
        console.error(err);
        setError('Error al cargar plantillas');
      } finally {
        setLoading(false);
      }
    };
    fetchData();
  }, []);

  const categories = Array.from(new Set(instances.map(i => i.template.category)));
  const filtered = filterCategory === 'all'
    ? instances
    : instances.filter(i => i.template.category === filterCategory);

  const toggleExpand = id => {
    setExpanded(e => ({ ...e, [id]: !e[id] }));
  };

  const toggleActivity = async (instanceId, idx, completed) => {
    try {
      const token = localStorage.getItem('token');
      await axios.post(
        `/api/routines/instances/${instanceId}/activities/${idx}`,
        { completed },
        { headers: { 'x-auth-token': token } }
      );
      setInstances(prev => prev.map(inst => {
        if (inst._id !== instanceId) return inst;
        const set = new Set(inst.completedActivities.map(Number));
        completed ? set.add(idx) : set.delete(idx);
        return { ...inst, completedActivities: Array.from(set) };
      }));
    } catch (err) {
      console.error('Error marcando actividad:', err);
    }
  };

  if (loading) return <p className="pt-empty">Cargando plantillas…</p>;
  if (error)   return <p className="pt-empty error">{error}</p>;

  return (
    <div className="patient-templates-page">
      <div className="pt-toolbar">
        <h1>Mis Plantillas Asignadas</h1>
        <select
          value={filterCategory}
          onChange={e => setFilterCategory(e.target.value)}
        >
          <option value="all">Todas las Categorías</option>
          {categories.map(cat => (
            <option key={cat} value={cat}>{cat}</option>
          ))}
        </select>
      </div>

      {filtered.length === 0 ? (
        <p className="pt-empty">No hay plantillas para esta categoría.</p>
      ) : (
        <div className="pt-list">
          {filtered.map(inst => {
            const tpl = inst.template;
            const total = tpl.activities.length;
            const done = inst.completedActivities.length;
            const pct = Math.round((done / total) * 100);
            const isOpen = expanded[inst._id];

            return (
              <div key={inst._id} className="pt-card">
                <div className="pt-header">
                  <div>
                    <h2>{tpl.name}</h2>
                    <div className="pt-progress">
                      <div
                        className="pt-bar"
                        style={{ width: `${pct}%` }}
                      />
                      <span>{pct}% completado</span>
                    </div>
                  </div>
                  <button
                    className="pt-expand"
                    onClick={() => toggleExpand(inst._id)}
                    title={isOpen ? 'Colapsar' : 'Expandir'}
                  >
                    {isOpen ? '▾' : '▸'}
                  </button>
                </div>

                {isOpen && (
                  <ul className="pt-activities">
                    {tpl.activities.map((act, idx) => {
                      const completed = inst.completedActivities.map(Number).includes(idx);
                      return (
                        <li key={idx} className={completed ? 'done' : ''}>
                          <button
                            className="pt-check"
                            onClick={() => toggleActivity(inst._id, idx, !completed)}
                            title={completed ? 'Marcar como pendiente' : 'Marcar como completada'}
                          >
                            {completed ? '✔' : '○'}
                          </button>
                          <div className="pt-desc">
                            <div className="pt-name">{act.name}</div>
                            <div className="pt-detail">
                              {act.desc} | Reto: {act.challenge} | Duración: {act.minutes} min
                            </div>
                          </div>
                        </li>
                      );
                    })}
                  </ul>
                )}
              </div>
            );
          })}
        </div>
      )}
    </div>
  );
}
